import React from "react";

const Fooditems = ({
  macro: { nutrientName, unitName, value, nutrientId },
}) => {
  return (
    <table>
    <tr>
        <th>nutrient type</th>
    </tr>
      {nutrientId > 1005 ? (
        <tr>
          <th>micro</th>
          <th>{nutrientName}</th>
          <th>{value}</th>
          <th>{unitName}</th>
        </tr>
      ) : (
        <tr>
          <th>macro</th>
          <th>{nutrientName}</th>
          <th>{value}</th>
          <th>{unitName}</th>
        </tr>
      )}
    </table>
  );
};

export default Fooditems;
